Des ondes positives avec le « #Festival Un Week-end avec Elles »

Aujourd’hui, nous avons eu le plaisir de découvrir la programmation de la 16ème édition du festival de #musique 100% féminin, « Un Week-End avec elles » qui se tiendra du 6 au 9 avril 2023.
